    render() {
        return (<div className="container-fluid">
            <center>
                <h2>Menu scheduler</h2>
            </center>
            <div className="container">
                <Bookings></Bookings>
                <Error></Error>
                <Meals></Meals>
            </div>
        </div>);
    }
}

export default App;
